  assemblies:
  - Cqrs
  namespace: Cqrs.Hosts
  summary: "\nGets executed after <xref href=\"Cqrs.Hosts.CqrsHttpApplication.Application_BeginRequest(System.Object%2cSystem.EventArgs)\" data-throw-if-not-resolved=\"false\"></xref>.\nExtracts the authentication token looking for a <xref href=\"System.Collections.Generic.KeyValuePair%602\" data-throw-if-not-resolved=\"false\"></xref> where the key as defined by the <xref href=\"System.Configuration.ConfigurationManager.AppSettings\" data-throw-if-not-resolved=\"false\"></xref> &quot;Cqrs.Web.AuthenticationTokenName&quot;,\nfrom the <xref href=\"System.Web.HttpRequest.Headers\" data-throw-if-not-resolved=\"false\"></xref>, if one isn&apos;t found we then try the following in order \n<xref href=\"System.Web.HttpRequest.Cookies\" data-throw-if-not-resolved=\"false\"></xref>, <xref href=\"System.Web.HttpRequest.Form\" data-throw-if-not-resolved=\"false\"></xref> or <xref href=\"System.Web.HttpRequest.QueryString\" data-throw-if-not-resolved=\"false\"></xref>; then\ncalls <xref href=\"Cqrs.Authentication.IAuthenticationTokenHelper%601.SetAuthenticationToken(%600)\" data-throw-if-not-resolved=\"false\"></xref> to make it accessible to others parts of the system if one is found.\n"
